import React from 'react';
import Darray from './Darray';
function Restartbtn(){
    return(
        <div className="col">
            <button className='btn btn-outline-secondary' onClick={()=>Darray.forEach((element,index) => {Darray[index]=Math.floor((Math.random()*100)+1)})}>reset</button>
        </div>
    );
}
export default Restartbtn;
